pragma solidity 0.4.24;

import "./interfaces/IERC1155.sol";
import "./zeppelin/lifecycle/Pausable.sol";

contract CFPresale is Pausable {
    mapping(uint => uint) public prices;
    mapping(address => address) public referrers;

    IERC1155 public tokenContract;
    address public tokenOwner;

    event Purchase(
        uint indexed tokenId,
        address indexed purchaser,
        address indexed referrer,
        uint price
    );

    event Withdraw(address owner, uint balance);

    constructor(address _tokenContract, address _tokenOwner) public Ownable() {
        require(_tokenContract != address(0), "Token contract required");
        tokenContract = IERC1155(_tokenContract);
        tokenOwner = _tokenOwner;
    }

    function setPrice(uint[] _tokenId, uint[] _price) public onlyOwner {
        for(uint i = 0; i < _tokenId.length; i++) {
            prices[_tokenId[i]] = _price[i];
        }
    }

    function ethPurchase(uint _tokenId, address _referrer) public whenNotPaused payable {
        uint price = prices[_tokenId];
        require(price > 0, "Invalid tokenId");
        require(msg.value == price, "Invalid payment");

        address referrer = referrers[msg.sender];
        if(referrer == address(0)){
            referrer = _referrer;
            referrers[msg.sender] = referrer;
        }
        tokenContract.transferFrom(tokenOwner, msg.sender, _tokenId, 1);

        emit Purchase(_tokenId, msg.sender, referrer, price);
    }

    function withdrawETH() public onlyOwner {
        uint balance = address(this).balance;
        owner.transfer(balance);

        emit Withdraw(owner, balance);
    }

    function itemBalances(uint[] _tokenIds) public view returns(uint[]) {
        uint[] memory balances = new uint[](_tokenIds.length);
        for(uint i = 0; i < _tokenIds.length; i++) {
            balances[i] = tokenContract.balanceOf(_tokenIds[i], tokenOwner);
        }
        return balances;
    }

    function itemPrices(uint[] _tokenIds) public view returns(uint[]) {
        uint[] memory _prices = new uint[](_tokenIds.length);
        for(uint i = 0; i < _tokenIds.length; i++) {
            _prices[i] = prices[_tokenIds[i]];
        }
        return _prices;
    }


}
